  static List<SurveryResult> listFromJson(dynamic json, {bool growable = false,}) {
    final result = <SurveryResult>[];
    if (json is List && json.isNotEmpty) {
      for (final row in json) {
        final value = SurveryResult.fromJson(row);
        if (value != null) {
          result.add(value);
        }
      }
    }
    return result.toList(growable: growable);
  }

  static Map<String, SurveryResult> mapFromJson(dynamic json) {
    final map = <String, SurveryResult>{};
    if (json is Map && json.isNotEmpty) {
      json = json.cast<String, dynamic>(); // ignore: parameter_assignments
      for (final entry in json.entries) {
        final value = SurveryResult.fromJson(entry.value);
        if (value != null) {
          map[entry.key] = value;
        }
      }
    }
    return map;
  }

  // maps a json object with a list of SurveryResult-objects as value to a dart map
  static Map<String, List<SurveryResult>> mapListFromJson(dynamic json, {bool growable = false,}) {
    final map = <String, List<SurveryResult>>{};
    if (json is Map && json.isNotEmpty) {
      // ignore: parameter_assignments
      json = json.cast<String, dynamic>();
      for (final entry in json.entries) {
        map[entry.key] = SurveryResult.listFromJson(entry.value, growable: growable,);
      }
    }
    return map;
  }

